Korea Północna może dodatkowo dostarczać Federacji Rosyjskiej swoje precyzyjne systemy rakietowe do celów artyleryjskich i rakietowych podają przedstawiciele Ministerstwa Obrony Korei Południowej

W szczególności kompleksy rakietowe z zachodnimi oznaczeniami:
📍 KN-23 (właściwie klon kompleksu rakiet operacyjno-taktycznych Iskander-M, zasięg szacowany jest na aż 600 km);
📍 KN-24 (klon amerykańskiego systemu rakiet operacyjno-taktycznych ATACMS, znany zasięg testowy to aż 410 km);
📍 Duże, precyzyjne rakiety o szacowanym zasięgu do 380 km (na zdjęciu).

Od sierpnia przez północnokoreański port Rason wysłano do Rosji ok. 2 tys. kontenerów z amunicją. Możliwe jest również, że KRLD wysłała pociski do dział starych czołgów T-55 i T-62.

North Korea may additionally supply the Russian Federation with its precision missile systems for artillery and rocket targets, according to South Korean Defence Ministry officials

In particular, missile complexes with Western designations:
📍 KN-23 (actually a clone of the Iskander-M operational-tactical missile complex, range estimated at as much as 600 km);
📍 KN-24 (a clone of the US ATACMS operational-tactical missile system, known test range is as high as 410 km);
📍 Large precision-guided missiles with an estimated range of up to 380 km (pictured).

Since August, some 2,000 containers of ammunition have been shipped to Russia via the North Korean port of Rason. It is also possible that the DPRK has sent missiles for the guns of old T-55 and T-62 tanks.

