⛪Сьогодні, 9 листопада, в церковному календарі – день пам’яті  преподобної Матрони Константинопольської.

Народилася вона у Східній Римській імперії 392 року. В молодому віці дівчину віддали заміж за багатого чоловіка. Коли у родини народилася донька, вони переїхали до Константинополя. Там Матрона почала часто відвідувати церкву, молитися і просити прощення за свої гріхи. Там же вона познайомилася з старицями Євгенією і Сусанною. Згодом жінка постриглася і пішла до монастиря Вассіана, але прикидалася там євнухом і мовчала.

Якось преподобному Вассіану наснився сон, що насправді молодий євнух — жінка. Викликав він наступного ранку до себе Матрону і почав розпитувати. Жінка про все розповіла йому і попросила захисту від переслідувань чоловіка. Тоді відправили її до жіночого монастиря Ємес, де вона з часом стала наставницею.

✅Народні прикмети цього дня:

✨пішов дощ — наступного року чекайте на великий урожай пшениці;
✨вранці іній — урожаю вівса не буде;
туман означає, що скоро прийде відлига;
✨почався снігопад — негода затягнеться надовго;
✨дерева вкриті інеєм — скоро прийдуть сильні морози.

