Rosja posiada około 870 precyzyjnych pocisków rakietowych o zasięgu ponad 350 km, poinformował ukraiński wywiad obronny.

Według Wadyma Skibickiego, przedstawiciela wywiadu obronnego Ukrainy, jest to w przybliżeniu:
📍165 rakiet Kalibr;
160 pocisków X-101, X-555 i X-55;
290 Iskanderów (M i K);
80 "Sztyletów"; 
150 pocisków X-22 / X-32.

W październiku Rosjanom udało się wystrzelić około 115 pocisków tego typu.

Russia has about 870 precision missiles with a range of more than 350km, Ukrainian defence intelligence has reported.

According to Vadym Skibitsky, a representative of Ukraine's defence intelligence, this is approximately:
📍165 Kalibr missiles;
160 X-101, X-555 and X-55 missiles;
290 Iskanders (M and K);
80 "Daggers"; 
150 X-22 / X-32 missiles.

In October, the Russians managed to launch around 115 missiles of this type.

