Этот день войдёт в историю 🇺🇦

❗️Коротко история оккупации Херсона:

- боевые действия в городе начались в первую неделю войны, войска рф подошли к Херсону 25 февраля 2022 года;
- город был полностью оккупирован 2 марта 2022 года;
- летом ВСУ пошли в контнаступление – оккупантов откинули с первой линии обороны Херсона;
- в сентябре оккупационные администрации объявили о проведении «референдумов», после путин заявил об  «аннексии»;
- 9 ноября россия объявила об отводе войск из Херсона на левый берег Днепра;
- 11 ноября ВСУ начали заходить в Херсон.

