«Результаты саммита хорошие, но если бы было приглашение, они были бы идеальны» - Зеленский

Главное с пресс-конференции президента и Генсека НАТО:
Столтенберг:
▪️НАТО будет продолжать поддерживать Украину, сколько потребуется;
▪️За прошлый год члены НАТО оказали Украине поддержку в десятки млрд долларов, сейчас мы согласовали пакет из трех частей, который приближает Украину к НАТО;
▪️Наша новая многолетняя программа поможет вам отойти от советских стандартов к стандартам НАТО;
▪️Cоюзники еще раз подтвердили, что Украина станет членом Альянса;
▪️Мы предоставим Украине приглашение в НАТО, когда союзники согласятся, что условия будут выполнены;
▪️Сегодня мы встречаемся как родные – жду того дня, когда мы встретимся как союзники.

Зеленский:
▪️Есть большие договоренности относительно оборонных пакетов с союзниками;
▪️Если G7 сегодня подтвердит гарантии безопасности, если это произойдет, то это будет конкретным успехом.
▪️Украина понимает, что не может быть членом НАТО, пока идет война. Мы со многими сегодня встречались, Украина будет членом НАТО, когда действительно соответствующие будут условия. Я подразумеваю под этим, что тогда, когда будет безопасно на нашей земле.
▪️Что касается приглашения. Я понимаю, что это технический сигнал. Но если мы посмотрим на это как серьезный фактор мотивации украинского общества, то для меня, как для президента, это был очень важный момент.

